import classes from "../marks.module.css"

const AddNew = ({setModal}) =>
{
    const click = () =>
    {
        setModal(true)
    }
    return (
        <div className={classes.addNew} onClick={click}>
            <p style={{fontSize: "16px"}}><strong>+</strong></p>
        </div>
    )
}

export default AddNew;
